import React from "react";
export default React.memo(function Card(props) {
  const foodCategory = props.foodCategory;
  const foodData = props.foodData;
  return (
    <div className="container">
      {
        foodCategory.map((catagoryData)=>{
          return (
            <>
              <div className="ps-1 pe-2 border-bottom border-white mt-2 mb-5 fs-4 fst-italic">{catagoryData.CategoryName}</div>
              <div className="row row-cols-4">
                {foodData.map((fData) => {
                  return (
                    fData.CategoryName === catagoryData.CategoryName && (
                      <div className="col" key={fData._id}>
                        <div
                          className="card mb-3"
                          key={fData._id}
                          style={{ width: "18rem" }}
                        >
                          <img
                            src={fData.img}
                            className="card-img-top"
                            style={{ objectFit: "cover", height: "200px" }}
                            alt="..."
                          />
                          <div className="card-body">
                            <h5 className="card-title ps-1">{fData.name}</h5>
                            <div className="d-flex align-items-center justify-content-between pe-1 ps-1">
                              <select
                                className="form-select w-75"
                                aria-label="Default select example"
                              >
                                <option selected>Quantity</option>
                                {
                                  Object.keys(fData.options[0]).map((key,index)=>{
                                    return (
                                      <option key={index}>
                                        {key} : {fData.options[0][key]}
                                      </option>
                                    );
                                  })
                                }
                              </select>
                              <button type="button" class="btn btn-primary">
                                Add
                              </button>
                            </div>
                          </div>
                        </div>
                      </div>
                    )
                  );
                })}
              </div>
            </>
          );
        })
      }
    </div>
  );
})
